import React from "react";
import Header from "../components/Header";
import SurveyForm from "../components/SurveyForm";

const Home = () => {
  return (
    <div>
      <Header />
      <main>
        <section>
          <h2>Welcome to Agent Mob</h2>
          <p>Automating tasks and streamlining workflows for your business.</p>
        </section>
        <section>
          <h3>Start Your Survey</h3>
          <SurveyForm />
        </section>
      </main>
    </div>
  );
};

export default Home;
